import React, { Component } from "react";
import SearchIcon from "./white-search-icon.jpg";
//import "./NavBar.css";

class Navbar extends Component {
  state = { options: [] };

  generateId() {
    return Math.random()
      .toString(36)
      .substr(2, 9);
  }

  render() {
    return (
      <nav className={this.props.navCls} /*"navbar"*/>
        <div>
          <ul>
            {this.props.options.map(option => {
              return (
                <li
                  className={this.props.navOptionCls}
                  /*"navbar-option"*/ key={this.generateId()}
                >
                  {option.title}
                  <div className="navbar-option-dot"></div>
                </li>
              );
            })}
          </ul>
        </div>
        <div>
          <img
            className="navbar-search-icon"
            height="23"
            width="23"
            alt="search"
            src={SearchIcon}
          ></img>
        </div>
      </nav>
    );
  }
}

export default Navbar;
